/**
 * @param {number[][]} isWater
 * @return {number[][]}
 */
 const dirs = [[1,0],[0,1],[-1,0],[0,-1]]
var highestPeak = function(isWater) {
    const m = isWater.length; 
    const n = isWater[0].length;
    const ans = new Array(m);
    for(let i=0;i<m;i++){
        ans[i] = new Array(n).fill(-1)
    }
    const queue = [];
    for(let i=0;i<m;i++){
        for(let j=0;j<n;j++){
            if(isWater[i][j] === 1){
                ans[i][j] = 0;
                queue.unshift([i,j])
            }
        }
    }
    while(queue.length){
        const p = queue.shift();
        for(const dir of dirs){
            let x = p[0]+dir[0],y=p[1]+dir[1];
            if(0<=x && x<m && 0<=y && y<n && ans[x][y] == -1){
                ans[x][y] = ans[p[0]][p[1]] + 1;
                queue.unshift([x,y])
            }
        }
    }
    return ans
};

